import pro1 from "../assets/image.jpg";
import pro2 from "../assets/BI.jpg";
import pro3 from "../assets/mobile.jpg";

const ProjectCardData = [
  {
    imgsrc: pro1,
    title: "Application de Gestion des Notes",
    text:
      "Ce projet a abouti à la création d'une application de gestion des notes adaptée aux besoins spécifiques. Cette solution simplifie considérablement la gestion académique en offrant des fonctionnalités efficaces, bénéfiques pour les administrateurs, et contribue ainsi à l'amélioration globale du processus académique.",
    view: "https://github.com/salahcurvasud/app-jee.git",
  },
  {
    imgsrc: pro2,
    title: "Visualisation Formula One with Tableau",
    text:
      "À travers cette visualisation, je vise à permettre l'exploration des données pour aider les utilisateurs de tous les niveaux d'expérience en Formule 1 à découvrir et à donner un sens aux données, que ce soit pour obtenir des informations objectives ou pour utiliser les informations afin de formuler des évaluations subjectives.",
  },
  {
    imgsrc: pro3,
    title: "Application de Gestion des Notes",
    text:
      "L'application mobile HelpCasaMobile vise à moderniser et simplifier les opérations de l'agence immobilière renommée -SeLoger-. Conçue pour une gestion efficace des annonces de location et de vente, ainsi que pour faciliter les interactions entre agents immobiliers, clients propriétaires et acheteurs, cette application offre une interface conviviale pour l'ajout, la recherche et la gestion des informations clés. Du suivi des annonces à la gestion des clients et au calcul automatisé des commissions, -HelpCasaMobile- se positionne comme l'outil essentiel pour optimiser les processus commerciaux de l'agence. Cette présentation met en avant notre engagement envers l'efficacité opérationnelle et l'amélioration de l'expérience utilisateur au sein de l'industrie immobilière.",
  },
];

export default ProjectCardData;
